import Link from 'next/link';
import ItemStyles from './styles/ItemStyles';
import Title from './styles/Title';

export default function Stat({ stat }) {

    console.log(stat)

    return <ItemStyles>
        <Link href={`/player/${stat.id}`}>
            <img 
                src={stat?.photo?.image?.publicUrlTransformed} 
                alt={stat.player_name} 
            />
        </Link>
        <Title>
            <Link href={`/player/${stat.id}`}>{stat.player_name}</Link>
        </Title>
        <p>{stat?.country_name}</p>
        <p>{stat?.player_birth_date}</p>
    </ItemStyles>;
}
